func (st *stat) Update(cost time.Duration) {
	st.mux.Lock()
	defer st.mux.Unlock()
	if cost > st.max {
		st.max = cost
	} else if cost < st.min {
		st.min = cost
	}
	st.count++
	st.sum += cost
	return
}

